import React from 'react'
import { Text, StyleSheet, View, Button,ImageBackground} from 'react-native'

const HomeScreen = (props) => {
  console.log(props)
  const navigation = props.navigation

  return (
    <ImageBackground>
    source={require('./caminho/para/sua/imagem.jpg')}
    style={styles.background} 

    <View   style={styles.principal}>
      <Text style={styles.text}>MATEUS DE PAULA CALCULATOR 2.O </Text>
      <View   style={styles.btn}>
      <Button 
        onPress={() => {
          console.log('button pressed')
          navigation.navigate('Calculadora1')
        }}
        title="CALCULADORA 1" />

      </View>

      <View   style={styles.btn} >
      <Button 
        onPress={() => {
          console.log('button pressed')
          navigation.navigate('Calculadora2')
        }}
        title="CALCULADORA 2" />
      </View>
    </View>
    </ImageBackground>
  )
}

const styles = StyleSheet.create({
  text: {
    fontSize: 30,
    textAlign: 'center',
  },
  btn: {
    marginVertical :25 ,
    marginHorizontal : '33%',

  },
  principal: {

    width: '100%',
    height:'100%'
  }
})

export default HomeScreen
